import React, { Component } from "react";
import { Link } from "react-router-dom"


export default class TaskTable extends Component {

    

    constructor(props) {
        super(props);

      

        this.state = {
            accounts : []
        }
    }

    componentDidMount(){         
        this.state.accounts = JSON.parse(localStorage.getItem("accounts"));      
        
        // this.state.accounts &&
        //  JSON.parse(localStorage.getItem()); 
               
      }
 
    render() {
        
        return (

            
        <table class="table">
         {this.state.accounts && this.state.accounts.map((account,index) => {
             return ( 
        <thead key= {index}>
       
            <tr>
            <th scope="row">#</th>
            <th scope="row">{account.account}</th>
            </tr>
            
        </thead>
        )})}
        <tbody>
            <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
            </tr>
            <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
            </tr>
            <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
            </tr>
        </tbody>
        </table>

        );
    }
}
